import React from "react";
import Appservices from './services';
import Appbanner from './banner';
import Appservicepart from './servicespart';
import Appexperience from './experience';
const home = () =>{
    return(
        <>
        <main>
        <Appbanner/>
        <Appservices/>
        <Appservicepart/>
        <Appexperience/>
        </main>
        </>
    );
}
export default home;
